import React from "react";
import styles from "../scss/Form.module.scss";
import Input from "../../UI/Input";
import Layout from "../../layout/Layout/Layout";
const Signin = () => {
  return (

      <div className={styles.form}>
        <Input
          input={{
            type: "email",
            id: "email",
            label: "Email",
            placeholder: "Email...",
          }}
        />
      </div>
  );
};

export default Signin;
